import React from 'react';
import { motion } from 'framer-motion';
import { FaRocket, FaLightbulb, FaCode, FaChartLine } from 'react-icons/fa';

const FeatureCard = ({ icon, title, description }) => (
  <motion.div
    whileHover={{ scale: 1.05 }}
    className="bg-gray-800 bg-opacity-50 backdrop-filter backdrop-blur-lg rounded-xl p-6 shadow-lg border border-gray-700"
  >
    <div className="text-indigo-400 mb-4">{icon}</div>
    <h3 className="text-xl font-semibold mb-2">{title}</h3>
    <p className="text-gray-300">{description}</p>
  </motion.div>
);

function Info1() {
  const features = [
    {
      icon: <FaRocket className="h-8 w-8" />,
      title: "Rapid Development",
      description: "Accelerate your project timeline with our cutting-edge tools and frameworks."
    },
    {
      icon: <FaLightbulb className="h-8 w-8" />,
      title: "Innovative Solutions",
      description: "Stay ahead of the curve with our forward-thinking approach to software development."
    },
    {
      icon: <FaCode className="h-8 w-8" />,
      title: "Clean Code",
      description: "Our emphasis on code quality ensures maintainable and scalable solutions."
    },
    {
      icon: <FaChartLine className="h-8 w-8" />,
      title: "Performance Optimized",
      description: "Deliver lightning-fast experiences with our performance-first mindset."
    }
  ];

  return (
    <section className="py-16 bg-gradient-to-b from-gray-900 to-gray-800">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-center mb-12"
        >
          <h2 className="text-3xl font-extrabold text-white sm:text-4xl">
            Why Choose <span className="text-indigo-400">TokTok</span>
          </h2>
          <p className="mt-4 text-xl text-gray-300">
            Empowering your vision with next-generation software development
          </p>
        </motion.div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8">
          {features.map((feature, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              <FeatureCard {...feature} />
            </motion.div>
          ))}
        </div>
      </div>
    </section>
  );
}

export default Info1;
